    dp = [[10 ** 18] * (n + 1), [10 ** 18] * (n + 1)]
    (dp[0][0], dp[1][0]) = (0, 0)
    for i in range(n):
        dp[0][i + 1] = get(dp[0][i], dp[1][i], tables[i], formulas[i])
        dp[1][i + 1] = get(dp[1][i], dp[0][i], formulas[i], tables[i])
    return 'YES' if min(dp[0][-1], dp[1][-1]) <= k else 'NO'
